import React from 'react';
import './App.css';
import logo from './logo.svg'; // поместите свой логотип в src/logo.svg

function App() {
  return (
    <div className="App">
      <header className="header">
        <div className="header__logo">
          <img src={logo} alt="Logo" />
        </div>
        <button className="header__login">Log in</button>
      </header>

      <main className="hero">
        <div className="hero__content">
          <h1 className="hero__title">Tired of wasting money &amp; energy?</h1>
          <p className="hero__subtitle">
            See how much you can save with our devices!
          </p>
          <button className="hero__button">Get started</button>
        </div>
      </main>
    </div>
  );
}

export default App;
